import React from 'react';
import { Link } from 'react-scroll';
import './Navbar.scss';

const Navbar = ({ toggleTheme, toggleLanguage, translations }) => {
    return (
        <nav className="navbar">
            <h1>My Portfolio</h1>
            <div className="navbar-links">
                <Link to="about" smooth={true} duration={600} offset={-100}>
                    {translations && translations.aboutTitle}
                </Link>
                <Link to="skills" smooth={true} duration={600} offset={-100}>
                    {translations && translations.skillsTitle}
                </Link>
                <Link to="projects" smooth={true} duration={600} offset={-100}>
                    {translations && translations.projects}
                </Link>
                <Link to="contact" smooth={true} duration={600} offset={-100}>
                    {translations && translations.contactTitle}
                </Link>
            </div>
            <div className="navbar-actions">
                <button onClick={toggleTheme}>Toggle Theme</button>
                <button onClick={toggleLanguage}>Toggle Language</button>
            </div>
        </nav>
    );
};

export default Navbar;
